import React from 'react';

class Table extends React.Component {
    constructor() {
        super();
        this.state = 
        {
            prospects: [],
        }
    }

 componentDidMount() {
     fetch('/getProspectData')
     .then(response => response.json())
     .then(prospects => this.setState({ prospects })); 
     };

renderData() {
    return this.state.prospects.map((prospect, index) => {
        const { id, name, email, phone, caseType, comments, notes, status, createdAt } = prospect//destructuring
        return (
            <tr key={id}>
                <td>{id}</td>
                <td>{name}</td>
                <td>{email}</td>
                <td>{phone}</td>
                <td>{caseType}</td>
                <td>{comments}</td>
                <td>{notes}</td>
                <td>{status}</td>
                <td>{createdAt}</td>
                <td><button>Delete</button></td>
            </tr>
           )
        })
     }

renderHeader() {
    return (
    <th>
        <td>Submission ID</td>
        <td>Name</td>
        <td>Email Address</td>
        <td>Phone Number</td>
        <td>Case Type</td>
        <td>Comments</td>
        <td>Notes</td>
        <td>Status</td>
        <td>Date Entered</td>
    </th>
        )};


render() { 
    // const clients = (this.state.data)
    return (
        // <p> {JSON.stringify(clients)}</p>
        <div>
            <h1 id='title'>Prospects:</h1>
            <table id='prospects'>
               <tbody>
                   <tr>{renderHeader()}</tr>
                  {this.renderData()}
               </tbody>
            </table>
         </div>
    )
}
};

export default Table;
